export default function Footer({ setPage }) {

  const go = (page) => {
    setPage(page);
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <footer className="footer">
      <div className="footer-inner">

        {/* BRAND */}
        <div className="footer-brand">
          <h3>ARCHONIK</h3>
          <p>
            Helping studios build, launch, and scale great games through expert
            production, publishing, and strategy services.
          </p>
        </div>

        {/* NAVIGATION */}
        <div className="footer-nav">
          <h4>Navigate</h4>

          <p onClick={() => go('home')}>Home</p>
          <p onClick={() => go('about')}>About</p>
          <p onClick={() => go('services')}>Services</p>
          <p onClick={() => go('contact')}>Contact</p>
        </div>

      </div>

      <div className="footer-bottom">
        Â© {new Date().getFullYear()} Archonik Consulting
      </div>
    </footer>
  );
}
